import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

// Import components
import StudentLogin from './components/student/StudentLogin';
import FeedbackForm from './components/student/FeedbackForm';
import FacultyLogin from './components/faculty/FacultyLogin';
import FacultyDashboard from './components/faculty/FacultyDashboard';
import AdminLogin from './components/admin/AdminLogin';
import AdminDashboard from './components/admin/AdminDashboard';

function App() {
  const [currentUser, setCurrentUser] = useState(null);
  const [userRole, setUserRole] = useState(null);

  const handleLogin = (role, userName = null) => {
    setUserRole(role);
    setCurrentUser(userName);
  };

  const handleLogout = () => {
    setUserRole(null);
    setCurrentUser(null);
  };

  const RoleSelector = () => (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-8">
          <div className="card">
            <div className="card-header bg-dark text-white text-center">
              <h2 className="mb-0">Student Feedback Sentiment Analysis</h2>
            </div>
            <div className="card-body">
              <div className="row g-3">
                <div className="col-md-4">
                  <div className="card h-100 border-primary">
                    <div className="card-body text-center">
                      <h5 className="card-title text-primary">Student</h5>
                      <p className="card-text">Submit feedback about faculty</p>
                      <button 
                        className="btn btn-primary w-100"
                        onClick={() => handleLogin('student')}
                      >
                        Continue as Student
                      </button>
                    </div>
                  </div>
                </div>
                <div className="col-md-4">
                  <div className="card h-100 border-info">
                    <div className="card-body text-center">
                      <h5 className="card-title text-info">Faculty</h5>
                      <p className="card-text">View your feedback analytics</p>
                      <button 
                        className="btn btn-info w-100"
                        onClick={() => handleLogin('faculty')}
                      >
                        Continue as Faculty
                      </button>
                    </div>
                  </div>
                </div>
                <div className="col-md-4">
                  <div className="card h-100 border-danger">
                    <div className="card-body text-center">
                      <h5 className="card-title text-danger">Admin</h5>
                      <p className="card-text">View all analytics & reports</p>
                      <button 
                        className="btn btn-danger w-100"
                        onClick={() => handleLogin('admin')}
                      >
                        Continue as Admin
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );

  // Student Flow
  if (userRole === 'student' && !currentUser) {
    return <StudentLogin onLogin={(name) => setCurrentUser(name)} />;
  }

  if (userRole === 'student' && currentUser) {
    return <FeedbackForm studentName={currentUser} />;
  }

  // Faculty Flow
  if (userRole === 'faculty' && !currentUser) {
    return <FacultyLogin onLogin={(name) => setCurrentUser(name)} />;
  }

  if (userRole === 'faculty' && currentUser) {
    return <FacultyDashboard facultyName={currentUser} onLogout={handleLogout} />;
  }

  // Admin Flow
  if (userRole === 'admin' && !currentUser) {
    return <AdminLogin onLogin={() => setCurrentUser('admin')} />;
  }

  if (userRole === 'admin' && currentUser) {
    return <AdminDashboard onLogout={handleLogout} />;
  }

  // Default role selector
  return <RoleSelector />;
}

export default App;
